import { Routes , Route } from "react-router-dom";
import Navbar from "./components/navbar";
import Home from "./pages/Home/home"

function App() {
  return (
    <div className="w-screen min-h-screen pl-3 pr-3 md:pl-14 md:pr-14 lg:pl-32 lg:pr-32  overflow-x-hidden">
      <Navbar/>
      <Routes>
        <Route path="/" element={<Home/>} />
      </Routes>
    </div>
  );
}

export default App;
